import React from 'react'; 


const Test = () =>{

    return (

        <section className="padding_top">
            <h2 className="test-h">Our service</h2>
        <div className="container">
          <div className="test">
                <h2 >Check Whether you have<br/> Parkinson's Disease or not</h2>
          </div>
          <div class="row justify-content-between align-items-center">

              <div id="drop-area">
                <form className='my-form' action = "/predict" method = "post" encType="multipart/form-data">  
                <p>Upload Your audio in .wav format here</p>
                <input type="file" name="file" id="fileElem"/>  
                <input className="button" htmlFor="fileElem" type = "submit" value="Select File"/> 
                </form>  
              </div>
          </div>
        </div>
        </section>


    );
  };

  export default Test;
  // export default Example;
